import './App.css';
import PersonToPerson from './pages/chat'
import Home from './pages/join_room';
import Navbar from './components/navbar';

import Signup from './pages/signup';
import login from './pages/login';

import { BrowserRouter, Routes, Route } from "react-router-dom";
import RoomContextProvider from './context/setRoomContext';
import UserContextProvider from './context/setUserContext';


function App() {

  return (
    <UserContextProvider>
    <RoomContextProvider>
    <div className="App w-screen h-screen bg-black overflow-hidden">
      <Navbar/>
      <BrowserRouter>
        <Routes>
          <Route path='' Component={Home} />
          <Route path='chat' Component={PersonToPerson} />
          <Route path='user/signup' Component={Signup} />
          <Route path='user/login' Component={login} />
        </Routes>
      </BrowserRouter>

    </div>
    </RoomContextProvider>
    </UserContextProvider>
  );
}

export default App;
